// Top of your file: Global fetch wrapper based on URL
function customFetch(url, options = {}) {
    const controller = new AbortController();
    const signal = controller.signal;
  
    // Abort if the request matches certain conditions (e.g., a URL)
    if (url.includes('example.com')) {
      setTimeout(() => controller.abort(), 5000);  // Abort after 5 seconds for specific URLs
    }
  
    return fetch(url, { ...options, signal });
  }
  
  // Use the customFetch function throughout your file
  customFetch('https://example.com/api/data')
    .then(response => response.json())
    .then(data => console.log(data))
    .catch(err => {
      if (err.name === 'AbortError') {
        console.log('Request aborted!');
      } else {
        console.error('Error:', err);
      }
    });
